import React from 'react';
import './nav.css';


function Nav()
{
  return  (
    <div>

    <ul>
    	<li>Home</li>
    	<li>About</li>
    	<li>Gallery</li>
    	<li>Contact us</li>
    </ul>

    </div>


  );

}

export default Nav;
